// import logo from './logo.svg';
import './App.css';
// import React from 'react';
import Navbar from './Navbar';
function App() {
  var mytitle = 'Henlo';
  var likes=123;
  return (
    <div className="App">
      <Navbar></Navbar>
      <div className='content'>
        <h1>{mytitle}</h1>
        <p>Liked by {likes} number of people</p>
        <p>{[1,2,3,4,45,6]}</p>
        <p>{Math.random() * 100}</p>

      </div>

    </div>
  );
}

export default App;
